import { NbMenuItem } from '@nebular/theme';

export const MENU_ITEMS: NbMenuItem[] = [
  {
    title: 'Dashboard',
    icon: 'nb-home',
    link: '/pages/dashboard',
    home: true,
  },
  {
    title: 'Funcionalidades',
    group: true,
  },
  {
    title: 'Conta',
    icon: 'nb-locked',
    children: [
      {
        title: 'Login',
        link: '/auth/login',
      },
      {
        title: 'Registrar',
        link: '/auth/register',
      },
      {
        title: 'Resetar Senha',
        link: '/auth/reset-password',
      },
    ],
  },
];
